import Carousel from "react-bootstrap/Carousel";
import "./slider.css";

function Slider() {
  return (
    <Carousel slide={false}>
      <Carousel.Item claasName=".slider">
        <img
          className="d-block w-100"
          src="https://images.squarespace-cdn.com/content/v1/5eca9f99dfb4ed54d3f284fa/1603979590864-0TWO8OJ327OJ8HKBG7DY/Fujifilm-6251+kopie%CC%88ren.jpg"
          alt="First slide"
        />
        <Carousel.Caption>
          <h3>First slide label</h3>
          <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
}

export default Slider;
